	dt_x[('S', '(9, (6.0, 15.0))')] = 0+(1.5*x[('I', '(9, (6.0, 15.0))')])-(15.0*x[('S', '(9, (6.0, 15.0))')])+beta_S_I_to_S_S*(0.0+x[('S', '(9, (8.0, 13.0))')]*4.0)+beta_S_S_to_S_I*(0.0+x[('S', '(9, (4.0, 17.0))')]*8.0)-(beta_S_I_to_S_S*x[('S', '(9, (6.0, 15.0))')]*3.0)-(beta_S_S_to_S_I*x[('S', '(9, (6.0, 15.0))')]*7.0)
	dt_x[('S', '(9, (8.0, 13.0))')] = 0+(1.5*x[('I', '(9, (8.0, 13.0))')])-(20.0*x[('S', '(9, (8.0, 13.0))')])+beta_S_I_to_S_S*(0.0+x[('S', '(9, (10.0, 11.0))')]*5.0)+beta_S_S_to_S_I*(0.0+x[('S', '(9, (6.0, 15.0))')]*7.0)-(beta_S_I_to_S_S*x[('S', '(9, (8.0, 13.0))')]*4.0)-(beta_S_S_to_S_I*x[('S', '(9, (8.0, 13.0))')]*6.0)

